(70, 1, 'об2', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 'об2', '', ''),
(71, 1, 'Смазочные материалы ', '&lt;p&gt;Вы внимательно прочтете мой профиль, то без труда узнаете мое настоящее \r\nимя и даже фамилию с отчеством. А подробности меня интересуют не из \r\nпраздного любопытства. Обычно они нужны для работы. Потому что холодное \r\nостекление - это алюминиевый профиль, а теплое - ПВХ. Все компании имеют\r\n различные материалы и фронт работ, поэтому глупо писать под копирку, \r\nосновываясь на материалах конкурентов. Но, дело ваше. Не смею \r\nзадерживать.&lt;/p&gt;', 'ывафы', '', ''),
(73, 1, 'Оборудование', '&lt;p&gt;&lt;strong&gt;У нас Вы найдете:&lt;/strong&gt;&lt;br&gt;&lt;br&gt;&lt;strong&gt;1&lt;/strong&gt; – Слесарный\r\n инструмент (молотки слесарные, молотки гвоздодеры, молотки рихтовочные,\r\n кувалды, киянки, ключи шестигранники, биты отверточные, отвертки, \r\nнаборы инструмента, головки, ключи свечные, ключи торцевые, удлинители, \r\nшарниры для сменных головок, воротки, ключи динамометрические, ключи \r\nбалонные, ключи рожковые, ключи накидные, ключи комбинированные, \r\nразводные, газовые, трубные, напильники, рашпили, надфили, циклевки, \r\nпатроны сверлильные, шарнирно-губцевый инструмент, пассатижи, кусачки, \r\nбокорезы, клещи, зубила, керны);&lt;br&gt;&lt;br&gt;&lt;strong&gt;2&lt;/strong&gt; – Столярный \r\nинструмент (струбцины, рубанки, скобели, топоры, колуны, топорища, \r\nстусла, пилы, ножовки, лобзики, долота, гвоздодеры, верстаки);&lt;br&gt;&lt;br&gt;&lt;strong&gt;3&lt;/strong&gt; – Измерительный инструмент (линейки, рулетки, микрометры, штангенциркули, угольники, угломеры, уровни, дальномеры);&lt;br&gt;&lt;br&gt;&lt;strong&gt;4&lt;/strong&gt;\r\n – Крепежные инструменты (заклепочники, заклепки, степлеры, скобы, \r\nсаморезы, тросы, кронштейны, дюбели, хомуты, перфорированный крепеж, \r\nшурупы);&lt;br&gt;&lt;br&gt;&lt;strong&gt;5&lt;/strong&gt; – Автомобильный инструмент (домкраты,\r\n растяжки гидравлические, тали, лебедки, прессы, съемники, масленки, \r\nворонки, хомуты, зимние аксессуары, ареометры, автомобильные аксессуары,\r\n специальные приспособления, пневмоинструмент, моечные машины);&lt;br&gt;&lt;br&gt;&lt;strong&gt;6&lt;/strong&gt;\r\n – Садовый инвентарь (пилы, секаторы, садовые ножницы, лопаты, грабли, \r\nкультиваторы, совки, мотыжки, наборы садового инструмента, метла, косы, \r\nвилы, серпы, парники, теплицы, опрыскиватели, распылители, адаптеры для \r\nшлангов, тройники, муфты, разветвители, шланги, катушки, лейки, \r\nрукомойники, ведра, перчатки, рукавицы, черенки, тачки, колеса, камеры, \r\nсадовые ограждения, товары для отдыха, декоративные аксессуары, мебель \r\nдля пикника, садовые тенты, палатки, посуда, термосумки, коврики для \r\nпикника, мангалы, решетки-гриль, шампуры, товары для зимнего отдыха, \r\nпленки, укрывные материалы, газонокосилки, триммеры, дозатор);&lt;br&gt;&lt;br&gt;&lt;strong&gt;7&lt;/strong&gt;\r\n – Режущий инструмент (сверла по дереву, по бетону, по металлу, насадки \r\nна перфоратор, коронки по металлу, сверла алмазы, сверла по керамической\r\n плитке и стеклу, диски, круги, фрезы, ленты, щетки для дрелей и УШМ, \r\nабразивные сетки, шкурка шлифовальная, губки для шлифования, \r\nполировальные диски, метчики, плашки, резьбонарезные наборы, ножовки по \r\nметаллу, полотна по металлу, ножницы по металлу, болторезы, труборезы, \r\nножи, лезвия для ножей);&lt;br&gt;&lt;br&gt;&lt;strong&gt;8&lt;/strong&gt; – \r\nСтроительно-отделочный инструмент (валики, бюгели, кюветы, ведра для \r\nкраски, кисти, щетки, сопутствующий малярный и строительный инструмент, \r\nшпатели, мастерки, лопатки, терки, гладилки, стеклорезы, стеклодомкраты,\r\n плиткорезы, обдирочный инструмент, крестики и клинья для кладки плитки,\r\n приспособления для укладки напольных покрытий, шприцы для выдавливания \r\nгерметиков, ленты малярные, скотчи, изоленты, уплотнители, «ФУМ» ленты, \r\nсредства для защиты труда, респираторы);&lt;br&gt;&lt;br&gt;&lt;strong&gt;9&lt;/strong&gt; – \r\nПрочее (перчатки универсальные, фонари, энергосберегающие лампы, \r\nгирлянды, ящики, шкафы, органайзеры, лотки, губки, салфетки, \r\nпакеты/мешки для мусора, ведра, тазы, вешалки для одежды, щетки, совки, \r\nшвабры, водосгоны, мышеловки, паяльники, замки, лупы, петли, инструмент \r\nдля сантехники, клеевые пистолеты, клеевые стержни, прожекторы, \r\nудлинители, керосиновые лампы, удлинители электрические, веревки, шнуры,\r\n сварочные аппараты, генераторы дизельные/бензиновые, электроинструмент,\r\n цепные пилы, станки сверлильные, бетоносмесители, тепловые пушки, \r\nлестницы, стремянки, водяные насосы, растворосмесители ОАО «Строймаш»).&lt;br&gt;&lt;br&gt;Более подробно со списком товаров, ценами и брендами Вы можете ознакомиться скачав прайс-лист.&lt;/p&gt;', 'Оборудование для станций', '', ''),
(72, 1, 'Автозапчасти', '&lt;p&gt;Закажите запчасти у нас, даже если необходимого товара не окажется в \r\nналичии мы быстро и недорого доставим его со складов наших поставщиков. \r\nТак же привезем под заказ любые запчасти которых нет в городе. Мы \r\nзанимаемся новыми и контрактными запасными частями (детали ходовой, \r\nдетали двигателя, кузовное, оптика, топливная система, система \r\nзажигания, конрактные ДВС и АКПП). Мы предоставляем гарантию на весь \r\nтовар, приобретенный у нас. Если у Вас нет времени для визита к нам, \r\nблагодаря удобным формам оплаты: безналичный (перевод на расчетный \r\nсчет), перевод на карту сбербанка, Вы можете заказать детали по \r\nтелефону. Также возможен наличный расчет, для этого необходимо подъехать\r\n к нам в офис.&lt;/p&gt;', 'Автозапчасти', '', ''),
(74, 1, 'Компрессора', '&lt;br&gt;&lt;p&gt;&lt;img src=&quot;http://autonext.dev/image/catalog/03.jpg&quot;&gt;&lt;img src=&quot;http://autonext.dev/image/catalog/vint_3.jpg&quot;&gt;&lt;img src=&quot;http://autonext.dev/image/catalog/vint_5.jpg&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Компрессоры можно разделить на два основных типа – это &lt;strong&gt;винтовые компрессоры&lt;/strong&gt;&amp;nbsp;и&amp;nbsp;&lt;strong&gt;поршневые компрессоры&lt;/strong&gt;.&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Поршневой компрессор&lt;/strong&gt;, который также ещё называют объемным&amp;nbsp;&lt;strong&gt;компрессором&lt;/strong&gt;,\r\n всасывает определённый объем воздуха и при помощи поршня, соединенного с\r\n коленчатым валом, сжимает исходный объем воздуха до меньшего объема.&amp;nbsp;&lt;strong&gt;Поршневые компрессоры&amp;nbsp;&lt;/strong&gt;бывают различных видов: масляные и безмасляные, с различным числом и объёмом цилиндров, с ременной или прямой передачей.&amp;nbsp;&lt;br&gt;Основным преимуществом&amp;nbsp;&lt;strong&gt;поршневых компрессоров&amp;nbsp;&lt;/strong&gt;является их простота и низкая стоимость по сравнению с&amp;nbsp;&lt;strong&gt;винтовыми компрессорами,&amp;nbsp;&lt;/strong&gt;а также и требуют меньших затрат на обслуживание.&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Поршневые компрессоры&amp;nbsp;&lt;/strong&gt;являются\r\n самыми распространенными в России странах СНГ, среди установленных \r\nкомпрессоров с производительностью до 100 м3/мин. Данная технология \r\nиспользуется для сжатия воздуха на протяжении уже двух столетий, в силу \r\nотносительной простоты её технической реализации.&amp;nbsp;&lt;br&gt;&lt;strong&gt;Поршневые компрессоры&amp;nbsp;&lt;/strong&gt;по своим характеристикам и ценовым параметрам предпочтительнее&amp;nbsp;&lt;strong&gt;компрессоров&amp;nbsp;&lt;/strong&gt;других типов в следующих случаях:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Большие перепады в потреблении сжатого воздуха.&amp;nbsp;&lt;strong&gt;Промышленные поршневые компрессоры&amp;nbsp;&lt;/strong&gt;одинаково хорошо работают в повторно-кратковременном режиме, когда они намного экономичнее, чем&amp;nbsp;&lt;strong&gt;винтовые компрессоры&amp;nbsp;&lt;/strong&gt;.&lt;/li&gt;&lt;li&gt;Неблагоприятные условия эксплуатации&amp;nbsp;&lt;strong&gt;компрессора&amp;nbsp;&lt;/strong&gt;. При неблагоприятных условиях эксплуатации&amp;nbsp;&lt;strong&gt;компрессора&amp;nbsp;&lt;/strong&gt;,\r\n например, при использовании в установках расфасовки цемента, на \r\nугольных складах или мельницах для помола зерна, либо при больших \r\nколебаниях температуры,&amp;nbsp;&lt;strong&gt;поршневые компрессоры&amp;nbsp;&lt;/strong&gt;обеспечивают более длительный срок службы.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;Компания МегаПром может вам предложить&amp;nbsp;&lt;strong&gt;поршневые компрессоры&amp;nbsp;&lt;/strong&gt;следующих видов:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Компрессоры с прямым и ременным приводом&lt;/li&gt;&lt;li&gt;Компрессоры передвижные для строительных работ&lt;/li&gt;&lt;li&gt;Компрессоры высокого давления и дожимные компрессоры (БУСТЕРЫ)&lt;/li&gt;&lt;li&gt;Компрессоры низкого давления (воздуходувки)&lt;/li&gt;&lt;li&gt;Компрессоры безмасляные медицинские&lt;/li&gt;&lt;/ul&gt;&lt;hr&gt;&lt;p&gt;&lt;strong&gt;Винтовые компрессоры&lt;/strong&gt;,\r\n были разработаны в 30 годы 20 века, когда экономика Европы развивалась \r\nбыстрыми темпами. Особенность данного вида объемных компрессоров \r\nзаключается в том, что рабочий орган винтового компрессора выполняется в\r\n виде червячных роторов, находящихся в зацеплении. Это значительно \r\nповлияло на повышение стабильной работы компрессора в различных условиях\r\n и температурных режимах.&amp;nbsp;&lt;br&gt;В отличие от поршневого, данный вид&amp;nbsp;&lt;strong&gt;компрессоров&amp;nbsp;&lt;/strong&gt;не имеет клапанов, что приводит к устранению механических нагрузок, которые вызывают разбалансировку&amp;nbsp;&lt;strong&gt;винтового компрессора&lt;/strong&gt;.\r\n При этом скорость вращения винтового блока компрессора значительно \r\nувеличивается. Эта особенность конструкции компрессора позволяет \r\nполучить достаточно высокую величины потока, что соответственно приводит\r\n к увеличению производительности работы&amp;nbsp;&lt;strong&gt;ротационного компрессора&lt;/strong&gt;,\r\n не изменяя габаритных размеров. Показатель соотношения мощности потока к\r\n габаритам компрессора равен 0,75 что для того времени был достаточно \r\nвысоким. Разность давления между входом компрессора и на выходе из&amp;nbsp;&lt;strong&gt;компрессора&lt;/strong&gt;,\r\n так называемое осевое усилие, принимается подшипниками, установленными в\r\n винтовом блоке компрессора. Изначально винт компрессора был \r\nсимметричным, но на сегодняшний день, он имеет различные сечения.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Винтовой компрессор&amp;nbsp;&lt;/strong&gt;обладает целым рядом преимуществ по сравнению с поршневыми или центробежными компрессорами.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;высокая надежность;&lt;/li&gt;&lt;li&gt;длительный ресурс работы;&lt;/li&gt;&lt;li&gt;возможность непрерывного круглосуточного функционирования;&lt;/li&gt;&lt;li&gt;простота монтажа и подключения;&lt;/li&gt;&lt;li&gt;сравнительно небольшие эксплуатационные затраты;&lt;/li&gt;&lt;li&gt;наличие системы автоматического управления;&lt;/li&gt;&lt;li&gt;более низкий уровень шума;&lt;/li&gt;&lt;li&gt;высокая чистота получаемого сжатого воздуха;&lt;/li&gt;&lt;li&gt;низкий уровень энергозатрат на куб. метр произведенного воздуха.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;Мы предлагаем Вашему вниманию&amp;nbsp;&lt;strong&gt;Винтовые компрессоры&lt;/strong&gt;&amp;nbsp;знаменитых\r\n производителей Германии, Италии, Беларуси и России. Отличное качество \r\nизготовления и конструктивные особенности позволяют проводить плановую \r\nпроверку винтовых компрессоров всего несколько раз в год. Использование \r\nвинтовой пары позволяет значительно снизить расход электроэнергии при \r\nодновременном повышении производительности. Учитывая темпы роста \r\nстоимости энергоносителей, винтовые компрессоры окупаются в первый год \r\nсвоей работы. Кроме того, некоторые винтовые компрессоры обладают \r\nвозможностью регулировать частоту вращения, что позволяет исключить \r\nработу в холостом режиме.&amp;nbsp;&lt;strong&gt;Винтовые компрессоры&amp;nbsp;&lt;/strong&gt;прекрасно\r\n подходит для оптимизации экономичного производственного процесса, как в\r\n условиях промышленного производства, так и для небольших предприятий.&lt;/p&gt;&lt;p&gt;Всегда в наличии на нашем складе винтовые компрессоры следующих производителей:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Компрессоры DALGAKIRAN (Турция)&lt;/li&gt;&lt;li&gt;Компрессоры REMEZA (Беларусь)&lt;/li&gt;&lt;li&gt;Компрессоры АВАС (Италия)&lt;/li&gt;&lt;li&gt;Компрессоры ALUP (Германия)&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 'Компрессоры', '', ''),
