INSERT INTO `oc_layout` (`layout_id`, `name`, `home_article`) VALUES
(1, 'Home', '&lt;p&gt;Автонекст &amp;ndash; входит в число лидеров по продажам автозапчастей , смазочных материалов и оборудования для автотехцентров в г. Новосибирск и Новосибирской области. Мы работаем с начала 2014 года, предоставляя своим клиентам только самые качественные запасные части и оборудование по доступной цене. Клиент, который работал с нами хотя бы раз, вернется с вероятностью 99,9 %. Мы поможем найти необходимую Вам запасную часть в кратчайшие сроки, по самой выгодной цене. Даже если товара нет на нашем складе, мы закажем его у наших поставщиков . Вы будете удивлены нашими ценами при заказе деталей!позвоните нам и мы решим Вашу проблему. Работа с нами оградит Вас от некачественного, неверно подобранного товара, т.к. в нашем штате работают только опытные специалисты в сфере обслуживания автомобилей и подбора запчастей. Мы берем на себя полную ответственность за применимость товара. Если Вам нужен помощник в поиске и подборе запасных частей, обратитесь к нам, мы ответственно, а главное с необходимой долей профессионализма найдем и доставим Вам запчасти. Если у вас нет времени и желания искать запасные части, позвоните нам, мы доставим их на дом. Принимаем наличный, безналичный расчет, перевод на банковскую карту.&lt;/p&gt;\r\n'),
