(17, 'compressor', '&lt;p&gt;Компрессоры можно разделить на два основных типа &amp;ndash; это &lt;strong&gt;винтовые компрессоры&lt;/strong&gt;&amp;nbsp;и&amp;nbsp;&lt;strong&gt;поршневые компрессоры&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Поршневой компрессор&lt;/strong&gt;, который также ещё называют объемным&amp;nbsp;&lt;strong&gt;компрессором&lt;/strong&gt;, всасывает определённый объем воздуха и при помощи поршня, соединенного с коленчатым валом, сжимает исходный объем воздуха до меньшего объема.&amp;nbsp;&lt;strong&gt;Поршневые компрессоры&amp;nbsp;&lt;/strong&gt;бывают различных видов: масляные и безмасляные, с различным числом и объёмом цилиндров, с ременной или прямой передачей.&amp;nbsp;&lt;br /&gt;\r\nОсновным преимуществом&amp;nbsp;&lt;strong&gt;поршневых компрессоров&amp;nbsp;&lt;/strong&gt;является их простота и низкая стоимость по сравнению с&amp;nbsp;&lt;strong&gt;винтовыми компрессорами,&amp;nbsp;&lt;/strong&gt;а также и требуют меньших затрат на обслуживание.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Поршневые компрессоры&amp;nbsp;&lt;/strong&gt;являются самыми распространенными в России странах СНГ, среди установленных компрессоров с производительностью до 100 м3/мин. Данная технология используется для сжатия воздуха на протяжении уже двух столетий, в силу относительной простоты её технической реализации.&amp;nbsp;&lt;br /&gt;\r\n&lt;strong&gt;Поршневые компрессоры&amp;nbsp;&lt;/strong&gt;по своим характеристикам и ценовым параметрам предпочтительнее&amp;nbsp;&lt;strong&gt;компрессоров&amp;nbsp;&lt;/strong&gt;других типов в следующих случаях:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Большие перепады в потреблении сжатого воздуха.&amp;nbsp;&lt;strong&gt;Промышленные поршневые компрессоры&amp;nbsp;&lt;/strong&gt;одинаково хорошо работают в повторно-кратковременном режиме, когда они намного экономичнее, чем&amp;nbsp;&lt;strong&gt;винтовые компрессоры&amp;nbsp;&lt;/strong&gt;.&lt;/li&gt;\r\n	&lt;li&gt;Неблагоприятные условия эксплуатации&amp;nbsp;&lt;strong&gt;компрессора&amp;nbsp;&lt;/strong&gt;. При неблагоприятных условиях эксплуатации&amp;nbsp;&lt;strong&gt;компрессора&amp;nbsp;&lt;/strong&gt;, например, при использовании в установках расфасовки цемента, на угольных складах или мельницах для помола зерна, либо при больших колебаниях температуры,&amp;nbsp;&lt;strong&gt;поршневые компрессоры&amp;nbsp;&lt;/strong&gt;обеспечивают более длительный срок службы.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;Компания МегаПром может вам предложить&amp;nbsp;&lt;strong&gt;поршневые компрессоры&amp;nbsp;&lt;/strong&gt;следующих видов:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Компрессоры с прямым и ременным приводом&lt;/li&gt;\r\n	&lt;li&gt;Компрессоры передвижные для строительных работ&lt;/li&gt;\r\n	&lt;li&gt;Компрессоры высокого давления и дожимные компрессоры (БУСТЕРЫ)&lt;/li&gt;\r\n	&lt;li&gt;Компрессоры низкого давления (воздуходувки)&lt;/li&gt;\r\n	&lt;li&gt;Компрессоры безмасляные медицинские&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;strong&gt;Винтовые компрессоры&lt;/strong&gt;, были разработаны в 30 годы 20 века, когда экономика Европы развивалась быстрыми темпами. Особенность данного вида объемных компрессоров заключается в том, что рабочий орган винтового компрессора выполняется в виде червячных роторов, находящихся в зацеплении. Это значительно повлияло на повышение стабильной работы компрессора в различных условиях и температурных режимах.&amp;nbsp;&lt;br /&gt;\r\nВ отличие от поршневого, данный вид&amp;nbsp;&lt;strong&gt;компрессоров&amp;nbsp;&lt;/strong&gt;не имеет клапанов, что приводит к устранению механических нагрузок, которые вызывают разбалансировку&amp;nbsp;&lt;strong&gt;винтового компрессора&lt;/strong&gt;. При этом скорость вращения винтового блока компрессора значительно увеличивается. Эта особенность конструкции компрессора позволяет получить достаточно высокую величины потока, что соответственно приводит к увеличению производительности работы&amp;nbsp;&lt;strong&gt;ротационного компрессора&lt;/strong&gt;, не изменяя габаритных размеров. Показатель соотношения мощности потока к габаритам компрессора равен 0,75 что для того времени был достаточно высоким. Разность давления между входом компрессора и на выходе из&amp;nbsp;&lt;strong&gt;компрессора&lt;/strong&gt;, так называемое осевое усилие, принимается подшипниками, установленными в винтовом блоке компрессора. Изначально винт компрессора был симметричным, но на сегодняшний день, он имеет различные сечения.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Винтовой компрессор&amp;nbsp;&lt;/strong&gt;обладает целым рядом преимуществ по сравнению с поршневыми или центробежными компрессорами.&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;высокая надежность;&lt;/li&gt;\r\n	&lt;li&gt;длительный ресурс работы;&lt;/li&gt;\r\n	&lt;li&gt;возможность непрерывного круглосуточного функционирования;&lt;/li&gt;\r\n	&lt;li&gt;простота монтажа и подключения;&lt;/li&gt;\r\n	&lt;li&gt;сравнительно небольшие эксплуатационные затраты;&lt;/li&gt;\r\n	&lt;li&gt;наличие системы автоматического управления;&lt;/li&gt;\r\n	&lt;li&gt;более низкий уровень шума;&lt;/li&gt;\r\n	&lt;li&gt;высокая чистота получаемого сжатого воздуха;&lt;/li&gt;\r\n	&lt;li&gt;низкий уровень энергозатрат на куб. метр произведенного воздуха.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;Мы предлагаем Вашему вниманию&amp;nbsp;&lt;strong&gt;Винтовые компрессоры&lt;/strong&gt;&amp;nbsp;знаменитых производителей Германии, Италии, Беларуси и России. Отличное качество изготовления и конструктивные особенности позволяют проводить плановую проверку винтовых компрессоров всего несколько раз в год. Использование винтовой пары позволяет значительно снизить расход электроэнергии при одновременном повышении производительности. Учитывая темпы роста стоимости энергоносителей, винтовые компрессоры окупаются в первый год своей работы. Кроме того, некоторые винтовые компрессоры обладают возможностью регулировать частоту вращения, что позволяет исключить работу в холостом режиме.&amp;nbsp;&lt;strong&gt;Винтовые компрессоры&amp;nbsp;&lt;/strong&gt;прекрасно подходит для оптимизации экономичного производственного процесса, как в условиях промышленного производства, так и для небольших предприятий.&lt;/p&gt;\r\n\r\n&lt;p&gt;Всегда в наличии на нашем складе винтовые компрессоры следующих производителей:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Компрессоры DALGAKIRAN (Турция)&lt;/li&gt;\r\n	&lt;li&gt;Компрессоры REMEZA (Беларусь)&lt;/li&gt;\r\n	&lt;li&gt;Компрессоры АВАС (Италия)&lt;/li&gt;\r\n	&lt;li&gt;Компрессоры ALUP (Германия)&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n');
