(63, 1, 'Ремень ГРМ Subaru Legacy / Legacy Wagon ej202', '&lt;p&gt;&lt;span style=&quot;font-family: ''Comic Sans MS'';&quot;&gt;Ремень ГРМ для автомобилей Subaru Legacy / Legacy Wagon двс ej202&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: ''Comic Sans MS'';&quot;&gt;Товар Оригинальный, срок доставки 1-2 дня&lt;/span&gt;&lt;/p&gt;', 'Ремень ГРМ Subaru Legacy / Legacy Wagon ej202', 'Ремень ГРМ Subaru Legacy / Legacy Wagon ej202', 'Ремень ГРМ Subaru Legacy / Legacy Wagon ej202', 'Ремень ГРМ Subaru Legacy / Legacy Wagon ej202');
